import axios from 'axios';
import { useState } from 'react'
import { useParams } from 'react-router';
import { useEffect } from 'react';
import s from '../styles/dog.module.css'

export default function DogDetail(id){
    const [dog,setDog] = useState(null);
    let params = useParams()
    console.log(params)

    useEffect(() => {
        try {
            axios.get('http://localhost:3001/api/dogs/{}')
            .then((response) => {
                setDog(response.data.value)
            })
        }
        catch(error){
            console.log(error)
        }
    })

    return <div>
        <h1>{dog.name} {dog.weight} {dog.height} {dog.lifespan} </h1>
        <img className={s.image} src={dog.image} alt='imagen'/> 
    </div>
}
